import {
    BrowserRouter,
    Route,
    Routes
} from "react-router-dom";

import App from "./App";
import Main from "./component/main/Main";



function Rout() {
    return (  
        <BrowserRouter>
            <Routes>
                <Route path="/main" element={<Main/>} />
                <Route path="/posts" element={<App />} />


                <Route path="*" element={<h1>Error!!!</h1>}/>
            </Routes>
        </BrowserRouter>
    );
}

export default Rout;
